import React from "react";
import { motion } from "framer-motion";
import Box from "../Components/box";
export default function page2(){
    
    return(
        <div>
            <motion.section className="div2"  
                
                animate={{x:100}}
                exit={{x}}
               
                transition={{duration:1,repeat:Infinity}}> </motion.section>
             <div className="div2" 
                >
                <motion.h1  >slfjsl</motion.h1>
               
                 </div>
                 <Box/>
        </div>
    )
        
    
}
